CREATE TABLE IF NOT EXISTS customer (
    id uuid,
    first_name text,
    last_name text,
    birth_date text
);

ALTER TABLE customer ADD PRIMARY KEY (id);

CREATE TABLE IF NOT EXISTS basket (
    id uuid,
    customer_id uuid,
    purchased_at TIMESTAMP WITH TIME ZONE
);

ALTER TABLE basket ADD PRIMARY KEY (id);
ALTER TABLE basket ADD FOREIGN KEY (customer_id) REFERENCES customer(id);

CREATE TABLE IF NOT EXISTS product (
    id uuid,
    name text,
    price NUMERIC(15, 2)
);

ALTER TABLE product ADD PRIMARY KEY (id);

CREATE TABLE IF NOT EXISTS basket_products (
    basket_id uuid,
    product_id uuid
);

ALTER TABLE basket_products ADD PRIMARY KEY (basket_id, product_id);
ALTER TABLE basket_products ADD FOREIGN KEY (basket_id) REFERENCES basket(id);
ALTER TABLE basket_products ADD FOREIGN KEY (product_id) REFERENCES product(id);





